import React from 'react';
import axios from 'axios';

function getToken() {
    console.log('Starting now')
    axios.defaults.headers.post['Access-Control-Allow-Origin'] = '*';
    var bodyFormData = new FormData();

    bodyFormData.append('username','testadmin');
    bodyFormData.append('password', 'testadmin');
    axios({
        method: 'POST',
        url:'http://127.0.0.1:8000/token',
        data: bodyFormData
    }) .then(function(response){
        console.log(response.data['access_token'])
    })   
}

const Login = () => {
    return(
        <div>
            <div className="tc bg-light-white contentpg dib br3 ma2 bw2 ba b--light-gray shcenter">
                <main className="pa3  black-80">
                    <form id="login" className="ba b--transparent ph0 mh0">
                        <div className="mt3">
                            <label className="db fw6 lh-copy f6" htmlFor="username">Username</label>
                            <input className="pa2 input-reset ba br3-l bg-transparent w-100" type="text" name="username" id="username" />
                        </div>
                        <div className="mv3">
                            <label className="db fw6 lh-copy f6" htmlFor="password">Password</label>
                            <input className="b pa2 input-reset ba br3-l bg-transparent w-100" type="text" name="password" id="password" />
                        </div>

                    </form>
                    <div className="">
                        <button className="b ph3 input-reset ba b--black br3-l bg-transparent grow pointer f5 dib w-20"
                            onClick={getToken()} />
                    </div>
                </main>
            </div>
        </div>
    )
}

export default Login
